import {Card, CardImg, CardImgOverlay, CardBody, CardTitle, CardText} from 'reactstrap';
import homeCardImage from '../../app/assets/images/teaPlanting.jpg';
// import './HomeCard.css'
const HomeCard = () => {
    return (
        <Card>
            <CardImg src={homeCardImage} alt='home-card-image' />
            {/* <CardBody>
                <CardText>{description}</CardText>
            </CardBody> */}
              <CardImgOverlay>
              <CardBody style={{ color: 'white', fontSize: '70px', textAlign: 'center' , fontWeight:'bold', paddingTop: '120px'}}>
              Embark on a Tea Journey
                Stay Calm and Drink Tea
            </CardBody>
              </CardImgOverlay>
        </Card>
    );
};

export default HomeCard;
